import React, { Component } from "react";

class Navigation extends Component {
  handleSelection = (id) => {
    if (id === 1) {
      console.log("Lämpötila");
    } else if (id === 2) {
      console.log("Salamat");
    }
  };
  handleData = () => {
    var parser = new Metolib.WfsRequestParser();
    parser.getData({
      url: SERVER_URL,
      storedQueryId: STORED_QUERY_OBSERVATION,
      requestParameter: "td",
      // Integer values are used to init dates for older browsers.
      // (new Date("2013-05-10T08:00:00Z")).getTime()
      // (new Date("2013-05-12T10:00:00Z")).getTime()
      begin: new Date(1368172800000),
      end: new Date(1368352800000),
      timestep: 60 * 60 * 1000,
      sites: "Helsinki",
      callback: function (data, errors) {
        // Handle the data and errors object in a way you choose.
        // Here, we delegate the content for a separate handler function.
        handleCallback(data, errors);
      },
    });
  };

  render() {
    return (
      <div id="nav">
        <ul className="nav nav-pills nav-fill bg-dark">
          <li className="nav-item">
            <a
              onClick={() => this.handleSelection(1)}
              className="nav-link text-white"
              href="#"
            >
              Lämpötilahistoria
            </a>
          </li>
          <li className="nav-item">
            <a
              onClick={() => this.handleSelection(2)}
              className="nav-link text-white"
              href="#"
            >
              Salamat
            </a>
          </li>
          <li className="nav-item">
            <a
              className="nav-link text-white"
              onClick={() => this.handleData()}
              href="#"
            >
              Testaa data
            </a>
          </li>
          <li className="nav-item">
            <a className="nav-link text-white" href="#">
              Jotain
            </a>
          </li>
        </ul>
      </div>
    );
  }
}

export default Navigation;
